// src/Skills.js
import React from 'react';

function Skills() {
    return (
        <section className="skills">
            <h2>TECHNICAL SKILLS:</h2>
            <ul>
                <li>Domain: Banking (Finacle Core Banking Solution)
                        Platform/OS: UNIX
                        Languages: SQL, PL/SQL
                        Scripting Languages: Finacle Scripting, Java Script
                        Tools: Oracle SQL, IReport (Jasper Report)</li>
                <li>CSS3</li>
                <li>JavaScript</li>
                {/* Add more skills as needed */}
            </ul>
        </section>
    );
}

export default Skills;
